import React, { Component } from "react";

require('../src/unittype')

export default class firstInput extends Component {

unit = (props) => <h1>{props.unit}</h1>


  render() {
    return (
      <div>
        <label htmlFor="fname">Enter Value :</label>
        <input
          type="text"
          id="input"
          // onChange={this.changeFirstInput}
          // value={this.state.firstInput}
        />
        <select id="firstUnit">
          <option value="N/A">Select Unit</option>
          <option value="FEET">FEET</option>
          <option value="INCH">INCH</option>
          <option value="YARD">YARD</option>
          <option value="CM">CM</option>
        </select>
      </div>
    );
  }
}
